SELECT (COUNT (?Seed) AS ?count) WHERE{
	 ?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/Song> . 
	MINUS{ 
		{?Seed 	 <http://dbpedia.org/ontology/runtime> 	 260.0 .} UNION 
		{?Seed 	 <http://dbpedia.org/ontology/recordLabel> 	 <http://dbpedia.org/resource/Interscope_Records> .} 
	} 
}

SELECT DISTINCT ?Seed WHERE{ 
	?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/Song> .
	?Seed 	 <http://dbpedia.org/ontology/producer> 	 ?count . 
} GROUP BY ?Seed 
 HAVING (COUNT(?count) >= 6)

